
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>Snack Pack Flights - Budget Ballers</title>
  <style>
    body {
      background-color: #000;
      color: #fff;
      font-family: 'Arial', sans-serif;
      margin: 0;
      padding: 20px;
      overflow-x: hidden;
    }

    .logo {
      display: block;
      margin: 0 auto 20px auto;
      width: 250px;
      animation: floatLogo 4s ease-in-out infinite;
    }

    @keyframes floatLogo {
      0%, 100% { transform: translateY(0); }
      50% { transform: translateY(-8px); }
    }

    .tier-box {
      border: 2px solid #00bfff;
      box-shadow: 0 0 20px #00bfff, 0 0 40px #00bfff, 0 0 60px #00bfff;
      border-radius: 10px;
      padding: 20px;
      margin: 20px auto;
      width: 90%;
      max-width: 700px;
      background-color: rgba(0, 0, 0, 0.7);
      animation: glowPulse 2s infinite alternate;
    }

    .tier-title {
      font-size: 28px;
      font-weight: bold;
      margin-bottom: 10px;
      color: #00bfff;
      text-shadow: 0 0 5px #00bfff;
    }

    .shimmer {
      background: linear-gradient(to right, #00bfff, #fff, #00bfff);
      -webkit-background-clip: text;
      -webkit-text-fill-color: transparent;
      animation: shimmerMove 2s infinite linear;
    }

    @keyframes shimmerMove {
      0% { background-position: -200% 0; }
      100% { background-position: 200% 0; }
    }

    @keyframes glowPulse {
      from { box-shadow: 0 0 20px #00bfff; }
      to { box-shadow: 0 0 40px #00bfff; }
    }

    .strain-table {
      width: 100%;
      border-collapse: collapse;
      margin-top: 10px;
    }

    .strain-table th, .strain-table td {
      border: 1px solid #00bfff;
      padding: 10px;
      text-align: center;
    }

    .strain-table th {
      background-color: #001f2f;
      color: #00bfff;
      text-shadow: 0 0 5px #00bfff;
    }

    .strain-table td {
      background-color: #000;
      color: #fff;
    }

    .delivery-hours {
      text-align: center;
      margin-top: 40px;
      font-size: 16px;
      color: #bbb;
      text-shadow: 0 0 3px #00bfff;
    }
  </style>
</head>
